INSERT INTO admin_panel_job VALUES(1,'4 days','Kochi, Kakkanad','Wires and limited','for 1 hr -  ₹100','An Electrician is a skilled professional who installs, maintains, and repairs electrical systems in buildings and structures. They execute wiring plans, install fixtures and equipment, and ensure safety compliance. Electricians have expertise in various electrical systems, tools, and safety regulations. An Electrician performs a variety of tasks, including executing electrical wiring plans, installing fixtures and equipment, troubleshooting malfunctions, and repairing electrical appliances.','Electrician','09175643321','2025-04-02 10:38:33.156503','admin@example.com','Active',6,'2025-04-02 13:28:50.543060',1,'');
INSERT INTO admin_panel_job VALUES(2,'1 week','Palakkad ﻿, near south mall','ABC Technologies','for 1 hr -  ₹150','A Carpenter is a construction professional who works with construction crews to build, adjust and repair wood frameworks in various construction projects. They work with their hands, using tools to build and install frameworks that last a lifetime!','Carpenter','0934567812','2025-04-02 15:14:53.235672','admin@example.com','Active',1,'2025-04-02 15:14:53.246069',1000,'');
INSERT INTO admin_panel_job VALUES(3,'5 days','Kochi, Kakkanad','Wires and limited','for 1 hr -  ₹150',replace(replace('Plumbers are responsible for the installation, modification, maintenance, and repair of plumbing fixtures for drainage and water systems.\r\n\r\nThe plumber job description entails overseeing the fitting and repair of sanitation systems such as bathtubs, showers, toilets, and sinks.\r\n\r\nThey also handle domestic appliances such as water heaters and dish washers to ensure they operate efficiently.','\r',char(13)),'\n',char(10)),'Plumber','982242256','2025-04-02 15:48:46.214320','admin@example.com','Active',8,'2025-04-02 15:48:46.239553',1000,'');
INSERT INTO admin_panel_job VALUES(4,'7 days','Thiruvananthapuram, near Bus stand','NC company & Co','for 1 hr -  ₹90','A Cleaner is a service industry worker who ensures the workplace is always clean and sanitary. They perform a range of duties, including dusting or mopping and sweeping floors. They also make sure restrooms, and common areas stay fresh by performing routine inspections every day at specified times.','Cleaner','934567822','2025-04-02 16:03:47.661066','admin@example.com','Active',1,'2025-04-02 16:03:47.707356',950,'');
INSERT INTO admin_panel_job VALUES(5,'7 days','Kottayam, near Mary hospital','NOC company','for 1 hr -  ₹90',replace(replace('A house cleaner is responsible for ensuring and obtaining the highest level of cleanliness around the environments of a residential area, such as bedrooms, bathrooms, and kitchens, and all public areas.\r\n\r\nHis/her job description entails carrying out all light cleaning duties in order to maintain private households or commercial establishments such as hotels and hospitals.\r\n\r\nIn other words, a house cleaner refers to an individual who is professionally saddled with the responsibility of providing and maintaining the highest or an optimized standard of comfort, cleanliness, and hygiene for customers or clients within or around their residential facilities.','\r',char(13)),'\n',char(10)),'House cleaner','922566714','2025-04-03 07:00:13.775437','admin@example.com','Active',7,'2025-04-03 07:00:13.783507',1200,'');
INSERT INTO admin_panel_job VALUES(6,'4 days','Thrissur, near Guruvayoor temple','QY Company & P.V.T Limited','for 1 hr -  ₹90',replace(replace('A painter is responsible for  painting interior and exterior surfaces of residential or commercial buildings using  paint, varnishes, lacquers, sealers, or stains.\r\n\r\nThe painter job description entails preparing walls and surfaces before executing the actual painting tasks.\r\n\r\nSo, they perform several pre-painting tasks including utilizing sandpaper, scraping to strip old paint, executing preparation work for the surfaces, and applying filler.\r\n\r\nPainters are also responsible for giving an extra touch to work done using power and hand tools to sand surfaces for further finishing and painting.','\r',char(13)),'\n',char(10)),'Painter','912233456','2025-04-03 09:18:20.814378','admin@example.com','Inactive',15,'2025-04-03 09:18:20.818681',1200,'');
