INSERT INTO admin_panel_job VALUES(9,'4 days','Kochi, Kakkanad','XYZ technologies','for 1 hr -  ₹100',replace(replace('Painter is an artist who paints pictures. He matches and applies paint to various surfaces, and completing touch-ups. A painter works on a variety of domestic and industrial projects ranging from re-decorating homes to applying heavy-duty finishes to large structures like bridges. For a domestic job, they use paint, varnishes and wallpaper to decorate rooms.\r\n\r\nThere are different types of Painters such as construction painters who paint new buildings, maintenance painters who touch up paint and maintain the condition of current paint jobs, artisan painters who apply decorative techniques to painted surfaces, or painting and coating workers who apply paint to cars, toys furniture and other manufactured products.','\r',char(13)),'\n',char(10)),'Painter','982242256','2025-05-21 08:00:13.644549','admin@example.com','Active',3,'2025-05-21 08:00:13.655220',1200,replace(replace('Sand. high Demand. Sand is a granular material that forms from the erosion of rocks that …\r\nSafety Procedures. high Demand. Safety procedures are a set of standardized procedures, …\r\nExterior Surfaces. high Demand. Here''s how Exterior Surfaces is used in Painter jobs: …\r\nExterior Painting. high Demand. Here''s how Exterior Painting is used in Painter jobs','\r',char(13)),'\n',char(10)));
